import React from 'react';

const AddUser = props => {
    return (
        <form>
            <label htmlFor="username">User Name</label>
            <input type="text" />
            <label htmlFor="userage">User Age (Number)</label>
            <input type="number" />
        </form>
    )

}

export default AddUser;
